CREATE DEFINER=`root`@`localhost` PROCEDURE `SE_PA_CambiarEstadoDiaFestivo` (IN `idD` INT)  NO SQL
BEGIN
#No se puede desactivar los estados de los días festivos que ya cumplieron la fecha.
