	UPDATE dias_festivos d SET d.estado=1 WHERE d.iddias_festivos=idD;
END IF;

SELECT 1 as respuesta;
ELSE
#No se puede modificar el estado por que ya caduco esa fecha.
SELECT 2 as respuesta;
END IF;
#...
END$$

