CREATE DEFINER=`root`@`localhost` PROCEDURE `SE_PA_ConsultarAsistenciasDesayunoOAlmuerzo` (IN `doc` INT(13), IN `fechaI` VARCHAR(10), IN `fechaF` VARCHAR(10), IN `evento` TINYINT(1))  NO SQL
