CREATE DEFINER=`root`@`localhost` PROCEDURE `SE_PA_ConsultarHorasExtrasAceptasORechazadas` (IN `doc` VARCHAR(13), IN `fechaI` VARCHAR(10), IN `fechaF` VARCHAR(10), IN `accion` TINYINT(1))  NO SQL
