CREATE DEFINER=`root`@`localhost` PROCEDURE `SE_PA_HorasTrabajadasNormalesOExtras` (IN `doc` VARCHAR(13), IN `fechaI` VARCHAR(10), IN `fechaF` VARCHAR(10), IN `evento` TINYINT(1), IN `estado` TINYINT(1))  NO SQL
