CREATE DEFINER=`root`@`localhost` PROCEDURE `SI_PA_CalcularRegistrarHorasTrabajadas` (IN `doc` VARCHAR(13), IN `idHorario` TINYINT(1), IN `fechaAsitencia` VARCHAR(20), IN `accion` TINYINT(1))  NO SQL
