  IF EXISTS(SELECT * FROM h_laboral h WHERE h.documento=doc AND h.fecha_laboral=DATE_FORMAT(fechaAsitencia,'%Y-%m-%d') AND h.idEvento_laboral=1) THEN#Actualizar
