    #SELECT 0;
  END IF;
  #...Eliminar horas extras si es que tiene...
  DELETE FROM h_laboral  WHERE documento=doc AND fecha_laboral=DATE_FORMAT(fechaAsitencia,'%Y-%m-%d') AND idEvento_laboral=2;
  #SELECT 2;
  #...
