              #...	 
            END IF;
        #validamos si tiene alguna asistencia de Desayuno---------------------------------------------------------------------------------------------------------------------------------4
       END IF;
 #Validacion de cuantos eventos tiene en un dia de evento normal.-------------------------------------------------------------------------------------------------------------------------5    
ELSE 
