CREATE DEFINER=`root`@`localhost` FUNCTION `SA_FU_CantidadDiasASumar` () RETURNS TINYINT(1) NO SQL
BEGIN

#horas del pedido.
DECLARE horaI time;
DECLARE horaF time;
