CREATE DEFINER=`root`@`localhost` FUNCTION `SE_FU_CalcularNumeroHorasPermisoEmpleados` (`doc` VARCHAR(13), `idHorario` TINYINT(1), `tipoP` TINYINT(1), `desde` VARCHAR(10)) RETURNS TINYINT(1) NO SQL
